import React from 'react';
import { Col, Container, Row } from 'react-bootstrap';

function Home() {
  return (
    <Container className='gen-page text-light' fluid>
      <Container>
        <Row>
          <Col className='p-3' md={12}>
            <center>
              <h1>Welcome to ArcZero</h1>
              <h3>Created by Dumb Fucks</h3>
            </center>
          </Col>
        </Row>
      </Container>
    </Container>
  );
}

export default Home;
